import React from 'react';

const Input = ({ type = 'text', value, onChange, placeholder, disabled, readOnly, className }) => (
  <input 
    type={type} 
    value={value} 
    onChange={onChange} 
    placeholder={placeholder} 
    disabled={disabled} 
    readOnly={readOnly}
    className={className}
  />
);

export default Input;
